public class Ex06비교연산자 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//비교연산자
		
		int num1 = 10;
		int num2 = 5;
		int num3 = 10;
		int num4 = 5;
		
		// 비교연산자의 결과값은 항상 true or false로 나온다
		// boolean
		System.out.println(num1 > num2);
		System.out.println(num1 < num2);
		System.out.println(num1 == num3);
		System.out.println(num1 != num3);
		System.out.println(num1 >= num3);
		System.out.println(num1 <= num3);	
		
				
	}

}
